(562, 'elementor_remote_info_feed_data', 'a:5:{i:0;a:5:{s:5:\"title\";s:43:\"Elementor Sites of the Month  April 2020\";s:7:\"excerpt\";s:73:\"Here are our top picks of Elementor sites for April 2020. Check them out!\";s:7:\"created\";s:10:\"1589783657\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:119:\"https://elementor.com/blog/showcase-april-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:1;a:5:{s:5:\"title\";s:43:\"Elementor Meetups  April 2020 Highlights\";s:7:\"excerpt\";s:210:\"After adopting the online format for the meetups, our communities are back together with 25 events and more than 1,000 attendees, empowering more web creators, a big step forward during these troubled times.\";s:7:\"created\";s:10:\"1589711796\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:128:\"https://elementor.com/blog/elementor-meetups-april-2020/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:2;a:5:{s:5:\"title\";s:75:\"Monday Masterclass: How to Create, Set up & Launch an Online Course Website\";s:7:\"excerpt\";s:154:\"This Monday Masterclass were showing you how you can share your knowledge and expertise in online courses, and how to monetize them, in 3 simple steps.\";s:7:\"created\";s:10:\"1589231200\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:128:\"https://elementor.com/blog/create-online-course-website/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:3;a:5:{s:5:\"title\";s:48:\"Everything You Need to Know About Design Systems\";s:7:\"excerpt\";s:215:\"Design systems help to streamline the product design process and make it more transparent and predictable. In this article, we will explore the concept of design systems and key steps to building new design systems.\";s:7:\"created\";s:10:\"1588758387\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:113:\"https://elementor.com/blog/design-system/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}i:4;a:5:{s:5:\"title\";s:36:\"The Spanish Community Comes Together\";s:7:\"excerpt\";s:174:\"Spanish web creators lead by example as they pull together from across the country, with Elementor communities growing in strength and numbers despite the Coronavirus crisis.\";s:7:\"created\";s:10:\"1588686489\";s:5:\"badge\";s:0:\"\";s:3:\"url\";s:124:\"https://elementor.com/blog/spanish-community-growth/?utm_source=wp-overview-widget&utm_medium=wp-dash&utm_campaign=news-feed\";}}', 'no'),
